function PreloadImage(a){this.element;this.parent=a}PreloadImage.prototype.addToPreloader=function(a,b){console.log("Creating image with url: "+b);this.element=$("<img />").attr("src",b);this.element.appendTo(a.container);this.parent=a.parent};PreloadImage.prototype.bindLoadEvent=function(){this.parent.imageCounter++;this.element[0].ref=this;new imagesLoaded(this.element,function(a){a.elements[0].ref.completeLoading()})};PreloadImage.prototype.completeLoading=function(){this.parent.imageDone++;var a=(this.parent.imageDone/this.parent.imageCounter)*100;console.log(a+"% - loaded "+this.element.attr("src"));this.parent.overlayLoader.updatePercentage(a);if(this.parent.imageDone==this.parent.imageCounter||a>=100){this.parent.endLoader()}};